/*
   LOG
   ---------
   In dit component houd je de gemaakte suggesties bij.
*/

const Log = ({ logEntries }) => {
  return (
    <div className="log-container">
      <h3>Gemaakte suggesties</h3>
      <p>Houd hier de gegeven suggesties bij.</p>
    </div>
  );
};

export default Log;
